import React,{Component} from 'react';
import * as ReactBoostrap from 'react-bootstrap';
import axios from "axios";


export default class ListarServicios extends Component {

  state={
    data:[],
    modalInsertar: false,
    modalEliminar: false,
    form:{
      id:'',
      nombre:'',
      tipoModal:''
    }
  }
  componentDidMount() {
    this.peticionGet();
  }

  peticionGet=()=>{
    axios.get('http://localhost:9090/servicios/listar').then(response=>{
      this.setState({data: response.data});
      console.log(response.data);
    }).catch(error=>{
      console.log(error.message);
    })
  }

  
  render() {
    return (
      <div>
        <h1>ListarServicios</h1>
        <div>
          <ReactBoostrap.Table striped bordered hover variant="dark">
            <thead>
              <tr>
                <th>#</th>
                <th>Nombre Servicio</th>
                <td>Borrar</td>
              </tr>
            </thead>
            <tbody>
              <tr>
                <td>1</td>
                <td>Mark</td>
                <td><ReactBoostrap.Button variant="secondary">Borrar</ReactBoostrap.Button></td>
              </tr>
              <tr>
                <td>2</td>
                <td>Jacob</td>
                <td><ReactBoostrap.Button variant="secondary">Borrar</ReactBoostrap.Button></td>
              </tr>
            </tbody>
          </ReactBoostrap.Table>
        </div>
      </div>
    );

  }
}
